              Sign up - it's free!
            </button>
          </div>
        </div>

        <div className="w-50  p-4">
          <img
            src="https://images.ctfassets.net/rz1oowkt5gyp/75rDABL8fyMtNLlUAtBxrg/c5e145977a86c41c47e17c69410c64f7/TrelloUICollage_4x.png?w=540&fm=webp"
            alt="homepage-img"
          />
        </div>
      </div>
    </React.Fragment>
  );
}

export default Homepage;
